import { StyleSheet} from 'react-native';
const BottomNavStyles = StyleSheet.create({
  normalicon:{
    color:'#1e2833',
    size:24
  },
  smalicon:{
    color:'#1e2833',
    size:29
  },
  infoicon:{
    size:25,
    color:"#1e2833",
    marginRight:15
  }
});
export {BottomNavStyles};
